import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from 'semantic-ui-react';

class Navigation extends React.Component {
	render() {
		return (
			<div>
				<Link to='/'>
					Home
				</Link>
				<Link to='/signin'>
					Sign In
				</Link>
				<Link to='/register'>
					Register
				</Link>
			</div>
		);
	}
};

export default Navigation;
